import React,{ useEffect, useState } from "react";
import { useHistory } from "react-router";

const Home=()=>{
     console.log('in home');
    const history=useHistory();
    const [userData,setUserData]=useState({});

    useEffect(()=>{
        callHome();

    },[]);
    
    const callHome= async ()=>{
        try {
            const res=await fetch('/todos/home',{
                method:'GET',
                headers:{
                    
                    Accept:"application/json",
                    "Content-Type":"application/json"

                },
                credentials:"include"
            });
            const data= await res.json();
            console.log(data);
            setUserData(data);
        } catch (error) {
            console.log(error);
        }
    }


    return(
        <div className="user" >
            <h1 class="user__title">hello { userData.email}</h1>
            <p>Max calories allowed: {userData.maxcal}</p>
        <br></br>
        <a href="/todos/createmeal">Create Meal </a><br></br>
        <a href="/todos/updatemeal">Update Meal</a><br></br>
        <a href="/todos/deletemeal">Delete Meal</a><br></br>
        <a href="/todos/fetchmeal">fetch Meal</a><br></br>
        </div>
        )

}
export default Home;
